import React from "react";
import "./About.css";

function About() {
  const skills = [
    { name: "JavaScript", link: "https://developer.mozilla.org/en-US/docs/Web/JavaScript" },
    { name: "React", link: "https://react.dev/" },
    { name: "Python", link: "https://www.python.org/" },
    { name: "Flask", link: "https://flask.palletsprojects.com/" }
  ];

  return (
    <div className="about-page">
      <h1>About Me</h1>
      <p>
        Hi, I am a passionate developer building modern web applications.
        This portfolio showcases my projects and skills.
      </p>

      <div className="skills-container">
        {skills.map((skill, index) => (
          <div className="skill-card" key={index}>
            {/* Placeholder for future logo */}
            <h3>{skill.name}</h3>
            <a href={skill.link} target="_blank" rel="noopener noreferrer">
              Visit {skill.name} Official Site
            </a>
          </div>
        ))}
      </div>
    </div>
  );
}

export default About;
